import React from 'react'

const Year = (props) => {

    const [pressBtn, setpressBtn] = useState(`<span className='yearbut' style={border: 3px gray inset} onClick={changeBtn}> &#171; {props.year} &#187;</span>`)

    changeBtn = () => {
        setpressBtn
    }

    return <div className='year'>
        <span className='yearbut'>&#171; {props.year} &#187;</span>
    </div>
    
}

export default Year
